import { React, useEffect, useState } from "react";
import axios from "axios";

const Kategorije = () => {
  const [kategorije, setKategorije] = useState({ hits: [] });
  useEffect(async () => {
    const result = await axios("http://localhost:5000/kategorije/");

    setKategorije(result.data);
  }, []);
  //console.log(kategorije);
  return (
    <ul id="predmeti">
      <li className="predmet">eq</li>
    </ul>
  );
};

export default Kategorije;
